css:
@-moz-document domain("videocyborg.com") {
::-webkit-scrollbar{
    width: 10px;
    border-radius: 1px;
    border: 1px solid hsl(0, 1%, 35%);
    background: #0c0b0b;
}
::-webkit-scrollbar-thumb{
    background: #353232;
    border-radius: 13px;
    border: 1px solid #c3c1c1
}
::-webkit-scrollbar-thumb:active {
    background-color: #000;
    border: 1px solid #a9a6a6
}
html {
   
    background-color: #0c0b0b

}

button::-moz-focus-inner {
    border: 1
}
.nav,
.nav .current {
    color: #fff
}
.nav {
      height: 30px;
    padding: 11px 0 15px;
    background-color: #0c0b0b;
    border-bottom: 1px solid #000;
    box-shadow: 0 0 26px #000;
    outline: 0
}
.nav a {
    color: #f4f4f4;
    padding-right: 1em;
    position: relative;
    top: -15px;
    text-decoration: none
}
.nav .pagename {
    background-color: #0c0b0b;
    font-size: 22px;
    top: -15px;
    margin-right: 25%
}
.image {
    font-weight: 700;
    font-size: 20px;
    background: #89100c;
    color: #fff;
    padding: 5px;
    margin-right: 0;
    border-radius: 2px;
    letter-spacing: 3px
}
.cyborg {
    font-weight: 700;
    font-size: 22px;
    color: #89100c
}
.logo {
    width: 40px;
    height: 40px
}
.nav-close {
    background: #fff;
    float: right;
    font-size: 28px;
    margin: -44px 31px;
    display: none;
    cursor: pointer;
    padding: 1px;
    border: 0

}
.title-logo {
    display: block;
    margin-left: auto;
    margin-right: auto
}
.title {
    color: #fff;
    text-align: center;
    font-size: 30px;
    font-weight: 400;
    letter-spacing: -1px;
    margin-top: 10px
}
.subtitle {
    color: #e2e2e2;
    font-weight: 400;
    font-size: 15px;
    text-align: center;
    margin-top: -25px;
    background-color: #3e3e3e;
    padding: 5px;
    width: 32%;
    margin-left: auto;
    margin-right: auto
}
.url-input {
    width: 80%;
    height: 30px;
    display: block;
    margin-right: auto;
    margin-left: auto;
    border-radius: 0
}
.url-error-text {
    width: 80%;
    display: block;
    margin-right: auto;
    margin-left: auto
}
.footer {
    position: absolute;
    left: 0;
    bottom: 0;
    width: 100%;
    color: #979797;
    text-align: center;
    height: 60px
}
.cpr {
    font-size: 12px;
    margin-right: 10px
}
.tc {
    font-size: 12px;
    text-decoration: none;
    color: #979797;
    margin-right: 5px
}
.main-app {
    margin-top: 60px
}
.apps {
    text-align: center;
    font-size: 25px;
    color: #979797;
    font-weight: 700
}
.oc {
    text-align: left;
    font-size: 15px;
    margin-top: -5px
}
.oc-img {
    float: left;
    margin-right: 5px
}
.link-apps {
    text-decoration: none;
    color: #fff
}
.link-apps:hover {
    color: #bfbfbf
}
.btn.download {
    background: #89100c;
    text-align: center;
    display: block;
    margin-left: auto;
    margin-right: auto;
    font-size: 25px;
    width: 40%;
    margin-top: 20px;
    font-weight: 700;
    border-top: 1px solid #a91c17;
    box-shadow: 0px 1px 3px 2px #a91c17;
}

.box {
    background: #cfcfcf;
    border-left: 5px solid #3e3e3e;
    padding: 1.5em
}
.boxok {
    color: #f4f4f4; 
    background: #1d1c1c;
    border-left: 5px solid #000;
    padding: 1.5em
}
.is-invalid-input {
    border-color: #ec5840;
    box-shadow: 0 0 23px #ec5840;
    background-color: #1d1c1c;
    border-radius: 0
}
.error {
    color: #ec5840;
    font-weight: 700
}
label > * {
    display: inline
}
form > * {
    display: block;
    margin-bottom: 10px
}
textarea,
input,
select {
    margin: 21px 0 0 0px;
    background: #0e0b0b;
    border: 1px solid #878787;
    border-radius: 11px;
    padding: 6px;
    width: 400px;
    box-shadow: 0px 0px 23px #878787;
    color: #878787;
}
textarea:focus,
input:focus,
select:focus {
    border-color: #fff;
    box-shadow: 0 0 23px #fff;
    color: #fff;
}
textarea,
input[type=text] {
    -webkit-appearance: none;
    outline: 0;
    font-size: 16px
}
.cssProgress .cssProgress-bar {
    display: block;
    float: left;
    width: 0%;
    height: 100%;
    background: #1d1c1c;
    box-shadow: inset 0 -1px 2px rgba(0, 0, 0, .1);
    -webkit-transition: width .8s ease-in-out;
    transition: width .8s ease-in-out
}
.cssProgress .cssProgress-label {
    position: absolute;
    overflow: hidden;
    left: 0;
    right: 0;
    color: #fff;
    font-size: 1.1em;
    text-align: center;
    font-weight: 700
}
.cssProgress .cssProgress-stripes,
.cssProgress .cssProgress-active {
    background-image: -webkit-linear-gradient( 135deg, rgba(255, 255, 255, 0.125) 25%, transparent 25%, transparent 50%, rgba(255, 255, 255, 0.125) 50%, rgba(255, 255, 255, 0.125) 75%, transparent 75%, transparent);
    background-image: linear-gradient( -45deg, rgba(255, 255, 255, 0.125) 25%, transparent 25%, transparent 50%, rgba(255, 255, 255, 0.125) 50%, rgba(255, 255, 255, 0.125) 75%, transparent 75%, transparent);
    background-size: 35px 35px
}
.cssProgress .cssProgress-active {
    -webkit-animation: cssProgressActive 2s linear infinite;
    -ms-animation: cssProgressActive 2s linear infinite;
    animation: cssProgressActive 2s linear infinite
}
.progress1 {
    background-color: #1d1c1c;
    box-shadow: inset 0 1px 3px rgba(0, 0, 0, .2)
}
.progress1 .cssProgress-bar {
    height: 28px
}
.progress1 .cssProgress-label {
    line-height: 28px
}
}
